Storyline:

     Ring Hassard (Audie Murphy) and father Jeff (Burl Ives), wild horse breakers, live in a hidden mountain eyrie because Jeff is wanted for a murder he didn't commit. Things change in their eyrie however, when they take in a lost young lady, Riley Martin (Wanda Hendrix), who finds that Ring has &quot;never seen a woman close up.&quot;



